  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0110260 includes discrete
  sample and profile data collected from ENDEAVOUR, JOHN P. TULLY and PARIZEAU in
  the Coastal Waters of SE Alaska, Gulf of Alaska and North Pacific Ocean from 1985-02-12
  to 2010-06-18. These data include CHLOROPHYLL, DISSOLVED INORGANIC CARBON (DIC),
  DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, Potential temperature (theta),
  SALINITY, TOTAL ALKALINITY (TA), WATER TEMPERATURE, nitrate + nitrite content (concentration),
  pH, phosphate and silicate. The instruments used to collect these data include Alkalinity
  titrator, CTD, Coulometer for DIC measurement, bottle and spectrophotometer.nnThese
  data were collected by Lisa A. Miller, Marty Davelaar, Joe Linguanti and Jim Christian
  of Department of Fisheries and Oceans; Institute of Ocean Sciences as part of the
  Line_P data set. CDIAC associated the following cruise ID(s) with this data set:
  Line P 64 cruisesnnThe International CLIVAR Global Ocean Carbon and Repeat Hydrography
  Program carries out a systematic and global re-occupation of select WOCE/JGOFS hydrographic
  sections to quantify changes in storage and transport of heat, fresh water, carbon
  dioxide (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\":
